import React from 'react';
import { Link } from 'react-router-dom';
import './App.css';

const regions = [
  'us-east',
  'eu-west',
  'eu-central',
  'us-west',
  'sa-east',
  'ap-southeast',
];

const App: React.FC = () => {
  return (
    <div className="App">
      <header className="App-header">
        <h1>DevOps Monitoring Dashboard</h1>
        <div className="region-links">
          {regions.map((region) => (
            <Link key={region} to={`/region/${region}`} className="region-link">
              {region.toUpperCase()}
            </Link>
          ))}
        </div>
      </header>
    </div>
  );
};

export default App;
